-- ----------------------------
--  Table structure for `t_stat_produces`
-- ----------------------------
DROP TABLE IF EXISTS `t_stat_produces`;
CREATE TABLE `t_stat_produces` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sys_account_id` varchar(36) DEFAULT NULL COMMENT '账号表主键',
  `group_id` varchar(36) DEFAULT NULL COMMENT '销售团队（组）ID',
  `department_id` varchar(36) DEFAULT NULL COMMENT '销售部门（团队）ID',
  `stat_channel` char(1) DEFAULT NULL COMMENT '渠道 1.译鱼  2.代客下单 3.crm 4.手机crm（暂定： 5.百度 6.360 7.腾讯 8.公众号',
  `order_type` char(1) DEFAULT NULL COMMENT '订单类型 1：快速翻译（线上），2：文档订单（线上、线下），3：口译服务（线下），4：其他',
  `stat_type` char(1) DEFAULT NULL COMMENT '统计类型 1：利润率，2：超时率/时长，3：返稿率/量，4：交付率/量',
  `stat_date` date DEFAULT NULL COMMENT '统计日期',
  `stat_result` decimal(11,2) DEFAULT NULL COMMENT '统计结果',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=454 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='平台统计生产数据表';

